import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Display = () => {
  const [formData, setFormData] = useState([]);

  useEffect(() => {
    const fetchFormData = async () => {
      try {
        const response = await axios.get('http://localhost:3001/grabformdata');
        setFormData(response.data);
        console.log(formData);
      } catch (error) {
        console.error(error);
      }
    };

    fetchFormData();
  });

  return (
    <div>
      {formData.length > 0 ? (
        formData.map((singleData) => (
          <div key={singleData._id}>
            <p>{singleData.firstName}</p>
            <p>{singleData.lastName}</p>
            <p>{singleData.email}</p>
            <p>{singleData.dob}</p>
            <p>{singleData.gender}</p>
            <img
              src={singleData.imageUrl}
              alt='Image123'
              style={{ width: '100%', maxWidth: '200px' }}
            />
          </div>
        ))
      ) : (
        <h1>Loading...</h1>
      )}
    </div>
  );
};

export default Display;
